The new KX100 is the entry-level model of the popular KX Series, extending the line to offer the benefits of the KX to a wider range of players. Featuring high quality materials and components with the great attention-to-detail workmanship that Cort is known for, the KX100 rocks hard without breaking your budget.CORT POWERSOUND DUAL HUMBUCKERS
The Cort Powersound humbuckers are high output to drive your amps and pedals hard while retaining excellent articulation.HARDTAIL BRIDGE
The hardtail bridge provides superb tuning stability and a punchy tone that cuts through the mix.
&nbsp;1VOLUME, 1TONE, 3WAY PICKUP SELECTOR
The simple 1 volume, 1 tone and 3-way toggle switch controls provide a variety of great sounds and allows you to focus on your playing.
&nbsp;JATOBA FINGERBOARD
Jatoba is a very dense and stiff wood that makes it ideal for the fingerboard usage. Jatoba produces strong fundamentals and volume projection with an emphasis on the high-mids.
&nbsp;BOLT ON CONSTRUCTION
The time-tested bolt-on construction produces a big, open sound.
